const Chivo300 = `@font-face { font-family: 'Chivo'; font-style: normal; font-weight: 300; src: local('Chivo Light'), local('Chivo-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const Chivo300italic = `@font-face { font-family: 'Chivo'; font-style: italic; font-weight: 300; src: local('Chivo Light Italic'), local('Chivo-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const ChivoItalic = `@font-face { font-family: 'Chivo'; font-style: italic; font-weight: 400; src: local('Chivo Italic'), local('Chivo-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const ChivoRegular = `@font-face { font-family: 'Chivo'; font-style: normal; font-weight: 400; src: local('Chivo Regular'), local('Chivo-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const Chivo700 = `@font-face { font-family: 'Chivo'; font-style: normal; font-weight: 700; src: local('Chivo Bold'), local('Chivo-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Chivo700italic = `@font-face { font-family: 'Chivo'; font-style: italic; font-weight: 700; src: local('Chivo Bold Italic'), local('Chivo-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Chivo900 = `@font-face { font-family: 'Chivo'; font-style: normal; font-weight: 900; src: local('Chivo Black'), local('Chivo-Black'), url('data:font/woff2;base64,') format('woff2'); }`;
